import React from 'react';
import './EventList.css';

function Eventname() {
  return (
    <div className="app">
      <Sidebar />
      <div className="main-content">
        <Header />
        <EventForm />
      </div>
    </div>
  );
}

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Events</h2>
      <ul>
        <li>Dashboard</li>
        <li>Events</li>
        <li>Settings</li>
      </ul>
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <h1>Create New Event</h1>
      <div className="notifications">
        <span>ðŸ””</span>
