      </div>
    </div>
  );
}

function EventForm() {
  return (
    <form className="event-form">
      <div className="form-group">
        <label>Event Name</label>
        <input type="text" />
      </div>
      <div className="form-group">
        <label>Event Date</label>
        <input type="date" />
